  \"2016-07-15T04:23:47.027193\",\n\t\"name\": \"physician-owned-hospitals\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Section 6001 of the Affordable Care Act
  of 2010 amended section 1877 of the Social Security Act to impose additional requirements
  for physician-owned hospitals to qualify for the whole hospital and rural provider
  exceptions. A physician-owned hospital is now generally prohibited from expanding
  facility capacity. However, a physician-owned hospital that qualifies as an applicable
  hospital or high Medicaid facility may request an exception to the prohibition from
  the Secretary.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
